  typography: {
      padding: '5px',
      marginBottom: '7px',
  },
  ul: {
      padding: '0',
  },
});

function PlanetInfo() {
  return (
    <>PlanetInfo</>
  );
}
 
PlanetInfo.propTypes = {
//   people: PropTypes.array
